A student, i.e. a person pursuing studies, who has been admitted to the university and has taken the oath, has certain rights on this account, student rights.

Student rights are set out in detail in § 2 para. 2 of the Rules and Regulations for First Degree Studies, Second Degree Studies and Uniform Master's Studies.

The Student Rights Team is a team operating at Jagiellonian University's Academic Dissertation Committee. Its task is to assist any student who requests assistance in the area of student rights.

The Student Rights Team can provide assistance, among other things.

\- writing a letter to the University authorities;

\- Interpretation of legal regulations in force at the University;

\- Mediation with a lecturer;

\- contact with the University administration;

\- matters related to the Jagiellonian Language Centre, the Physical Education Department, and the Pedagogical Department;

\- defending their rights and fulfilling their duties;

\- other issues related to the course of studies.

To contact the Student Rights Team, please:

\- write an email to prawa.studenta@samorzad.uj.edu.pl

or

\- come to the duty hours of the Chairperson of the University Teaching Committee in the office of the Jagiellonian University Students' Self-Government (ul. Czapskich 4, 31-110 Kraków)

The academic year lasts from 1 October to 30 September. By May 1 of the year preceding the following academic year, the academic year plan for the coming year is published. Two weeks before the beginning of the year, the dean announces the timetable for the studies involved.

The year is divided into two semesters, winter and summer. The schedule includes the following terms.

\- classes - lectures, laboratories, exercises, conversation classes, seminars, proseminaries, and practical classes; their purpose is to implement the study plan and the curriculum;

\- examination session; there are two basic sessions, winter and summer, as well as two resit sessions; this is the time when there are no classes but only examinations;

\- days off from classes: semester break (a break of several days between the winter session and the re-session), Christmas break, and holiday break.

Rok akademicki trwa od 1 października do 30 września. Do 1 maja roku poprzedzającego kolejny rok akademicki ogłaszany jest plan roku akademickiego na przyszły rok. Dwa tygodnie przed rozpoczęciem roku dziekan ogłasza harmonogram dla danych studiów.

Rok podzielony jest na 2 semestry – zimowy oraz letni. Uwzględnione są w nim terminy:

• zajęć dydaktycznych - wykłady, laboratoria, ćwiczenia, konwersatoria, seminaria, proseminaria oraz praktyki; ich celem jest realizacja planu studiów i programu kształcenia;

• sesji egzaminacyjnej - występują dwie zasadnicze sesje - zimowa i letnia, oraz dwie poprawkowe;  jest to czas, w którym nie odbywają się zajęcia dydaktyczne tylko egzaminy;

• dni wolnych od zajęć: przerwa semestralna (kilkudniowa przerwa między zimową sesją zasadniczą a poprawkową), przerwa świąteczna, przerwa wakacyjna.

Student, czyli osoba kształcąca się na studiach, która została przyjęta na studia i złożyła ślubowanie, posiada z tego tytułu pewne uprawnienia - prawa studenta.

Prawa studenta są szczegółowo zawarte m.in. w § 2 ust. 2 Regulaminu studiów pierwszego stopnia, drugiego stopnia oraz jednolitych studiów magisterskich.

Zespół Praw Studenta jest to zespół, działający przy Uczelnianej Komisji Dydaktycznej Uniwersytetu Jagiellońskiego. Jego zadaniem jest pomoc każdemu studentowi, który zgłosi się po pomoc z zakresu praw studenta.

Od Zespołu Praw Studenta można uzyskać pomoc m.in. w:

• napisaniu pisma do Władz Uczelni;

• interpretacji regulacji prawnych obowiązujących na Uczelni;

• mediacji z wykładowcą;

• kontakcie z administracją Uczelni;

• sprawach związanych z Jagiellońskim Centrum Językowym i Studium Wychowania Fizycznego, a także Studium Pedagogicznym;

• obronie praw i realizacji swoich obowiązków;

• innych sprawach związanych z tokiem studiów

Aby skontaktować się z Zespołem Praw Studenta należy:

• napisać wiadomość na adres prawa.studenta@samorzad.uj.edu.pl

albo

• przyjść na dyżur Przewodniczącego Uczelnianej Komisji Dydaktycznej w biurze Zarządu Samorządu Studentów Uniwersytetu Jagiellońskiego (ul. Czapskich 4, 31-110 Kraków)

Po skreśleniu z listy studentów istnieje możliwość ponownego przyjęcia na studia, na danym kierunku studiów (wznowienie studiów):

• wniosek o ponowne przyjęcie na dany kierunek studiów składa się do dziekana odpowiedniego kierunku. W przypadku pozytywnego rozpatrzenia wznowienie studiów na danym kierunku następuje od początku następnego roku akademickiego;

UWAGA!!! Dziekan nie może wyrazić zgody na wznowienie studiów na danym kierunku, jeśli skreślenie z listy studentów nastąpiło z powodu ukarania karą dyscyplinarną wydalenia z uczelni.

• jeżeli przerwa związana ze skreśleniem z listy studentów wynosi więcej niż 5 lat, ponowne przyjęcie na studia następuje na zasadach rekrutacji na pierwszy rok studiów, chyba że dziekan postanowi inaczej;

• jeśli wykreślenie z listy studentów nastąpiło na pierwszym roku studiów nie można się ubiegać w trybie powyższego wniosku o ponowne przyjęcie na studia. Konieczne jest ponowne przejście procesu rekrutacji;

• punkty ECTS zdobyte wcześniej w ramach wznowionego kierunku zostają przepisane, jednak ich ilość może być mniejsza, jeśli któremuś z przedmiotów zmienił się program, w skrajnym przypadku zaliczenie przedmiotu może zostać nieuznane. Różnice muszą być przez studenta uzupełnione;

• wznowienie studiów uznaje się za kontynuację poprzedniego toku studiów;

• wznowienie studiów w ramach tego samego kierunku jest możliwe tylko raz. Jeśli dany kierunek studiów nie jest już prowadzony, niemożliwe jest wznowienie studiów;

• jeśli wykreślenie z listy studentów nastąpiło przed wejściem w życie aktualnego Regulaminu Studiów a student rozpoczyna studia na innym kierunku, dziekan tego innego kierunku może zaakceptować wniosek o wznowienie studiów, jeśli efekty nauczania będą zbieżne, biorąc pod uwagę różnice programowe;

• jeśli trzecie podejście do zdania egzaminu dyplomowego zakończy się niepowodzeniem, to nie jest możliwe wznowienie studiów na danym kierunku.

Student może ubiegać się o zwolnienie z części lub całości opłat za usługi edukacyjne związane z: 

 1) kształceniem na studiach niestacjonarnych; 

2) kształceniem na studiach w języku obcym; 

3) kształceniem cudzoziemców na studiach stacjonarnych w języku polskim; 

4) powtarzaniem określonych zajęć na studiach stacjonarnych z powodu 

niezadowalających wyników w nauce; 

5) prowadzeniem zajęć nieobjętych programem studiów. 

 \
Zgodnie z § 11 ust. 2 student może ubiegać się o zwolnienie w szczególnie uzasadnionych przypadkach. Do takich zalicza się w szczególności sytuacja: 

1) gdy z przyczyn losowych student znalazł się po rozpoczęciu studiów \
w wyjątkowo trudnej sytuacji materialnej; 

2) uzyskiwania wybitnych wyników w nauce; (warunek: średnia za poprzedni rok studiów co najmniej 4,75);

3) uczestnictwa w międzynarodowych programach wymiany. 

 Powyższy zbiór jest katalogiem otwartym, co oznacza, że student nie jest ograniczony tylko tymi trzema przypadkami, ale może złożyć wniosek również w każdej innej szczególnej okoliczności, którą uzna za zasadną do bycia podstawą do zwolnienia z opłat.  

 Do wniosku o zwolnienie student jest zobowiązany załączyć w zależności od podstawy zwolnienia: komplet dokumentów potwierdzających okoliczności uzasadniające udzielenie zwolnienia, w szczególności: 

1) komplet dokumentacji niezbędnej do ustalenia dochodu na jednego członka rodziny, potwierdzający sytuację materialną, zgodnie z wymogami ubiegania się o stypendium socjalne określonymi w odrębnych przepisach; 

2) dokumenty potwierdzające zaistnienie przyczyn losowych; 

3) opinię jednostki w systemie pomocy społecznej odpowiedzialnej za ustalenie sytuacji dochodowej i majątkowej osób i rodzin; 

4) inne dokumenty potwierdzające okoliczności wskazane we wniosku. 

Wniosek o zwolnienie z opłat należy złożyć w terminie do 20 września roku poprzedzającego rok akademicki, którego dotyczy opłata. Wniosek może być́ złożony po upływie terminu, o którym mowa w ust. 1, jeżeli przyczyna uzasadniająca zwolnienie lub obowiązek wniesienia opłaty powstały w trakcie roku akademickiego. W takim przypadku wniosek należy złożyć w terminie 14 dni od powstania przyczyny lub obowiązku wniesienia opłaty, jednak nie później niż do końca maja danego roku akademickiego. Za taki przypadek należy uznawać chociażby opłaty za powtarzanie przedmiotów, gdyż przyczyna uzasadniająca obowiązek zapłaty (naliczenie określonej kwoty) następuje w momencie, kiedy student otrzymuje informację o takim zobowiązaniu (w praktyce: pojawia się ona w systemie USOSweb w odpowiedniej zakładce związanej z płatnościami). 

Pismo powinno być zaadresowane do dziekana określonego wydziału. Nie ma oficjalnego wzoru takiego podania. Niektóre wydziały na swoich stronach posiadają własne wzory. Poniżej udostępniamy wzór Samorządu Studentów UJ: 

Jeżeli wniosek nie zostanie rozpatrzony pozytywnie lub zostanie rozpatrzony tylko w części, studentowi przysługuje wniosek o ponowne rozpatrzenie sprawy, który należy złożyć do prorektora ds. dydaktyki w terminie 14 dni od daty doręczenia decyzji dziekana. 

Student może wnioskować również o rozłożenie płatności na raty lub wydłużenie terminu spłaty na zasadach opisanych wyżej.

